import { Typography, Box, Switch, Link } from "@mui/material";
import colors from "../utils/colors";
import { slide as Menu } from 'react-burger-menu';

const Nav = ({mediaQuery, changeLanguage, language, links}) => {

    const handleLanguageChange = () => {
        if (language === 'es') {
            changeLanguage('en');
        }else{
            changeLanguage('es');
        }
    }

    return (
        <Box
            width="100%"
            display="flex"
            border="1px solid black"
            justifyContent="space-between"
            alignItems="center"
        >
            <Box
                display="flex"
                justifyContent="center"
                flexWrap="wrap"
            >
                <img src={`${process.env.PUBLIC_URL}/img/logo.png`} alt="Logo" 
                    style={{ width: '25%', height: 'auto', maxWidth: "100%", minWidth:"300px", border: `1px solid ${colors.bluey}`}} 
                />
            </Box>

            <Box
                border="2px solid black"
                padding="1rem"
                borderRadius="50px"
                width="25%"
                justifyContent="center"
                sx={{display: (mediaQuery ? 'flex' : 'none')}}
            >
                {Object.keys(links).map((link, index) => {
                    return (
                        <Link key={index} href={links[link]} underline="none"
                            style={{
                                margin: '0 1rem',
                                fontSize: '1.25rem',
                                color: "black",
                                textDecoration: 'none',
                                cursor: 'pointer'
                            }}
                        >
                            {link}
                        </Link>
                    );
                })}
            </Box>

            <Box
                display="flex"
                justifyContent="right"
                alignItems="center"
                border={`1px solid ${colors.bluey}`}
                width="25%"
            >
                <Typography
                    style={{marginRight: '1rem', fontSize: '1.5rem'}}
                >
                    Esp
                </Typography>
                <Switch 
                    checked={language === 'en'}
                    onChange={handleLanguageChange}
                    color="success"
                />
                <Typography 
                    style={{margin: '0 1rem', fontSize: '1.5rem'}}
                >
                    Eng
                </Typography>
            </Box>



        </Box>
    );
}

export default Nav;
